    throws IOException, JsonProcessingException
{
    if (_dataFormatReaders != null) {
        return _detectBindAndReadValues(_dataFormatReaders.findFormat(src, offset, length), false);
    }
    // Create a new input stream that ignores the first offset bytes
    InputStream subStream = new ByteArrayInputStream(src, offset, length);
    return _bindAndReadValues(_considerFilter(_parserFactory.createParser(subStream), 
            true));
}
